import React from 'react'
import { useNavigate } from 'react-router-dom';
import { Container, Logo, Nav, NavLink } from './HeaderElements';

const Header = () => {
    let navigate = useNavigate();

    return (
        <Container>
            <Logo>
                <span>Julian van Beek</span>
                <span>Web Designer</span>
            </Logo>
            <Nav>
                <NavLink to='/'>
                    Home
                </NavLink>
                <NavLink to='/portfolio'>
                    Portfolio
                </NavLink>
                <NavLink to='/about'>
                    About
                </NavLink>
                <NavLink to='/contact'>
                    Contact
                </NavLink>
            </Nav>
        </Container>
    );
}

export default Header;
